import React from "react";

const Slide = ({ id, title, url }) => {
  return (
    <div className="slide">
      <div className="slide_title">{title}</div>
      <div className="slide_image">
        <img src={url} alt={title} />
      </div>
    </div>
  );
};

export default Slide;
